import React, { FC } from 'react';

interface HeadingProps {
  heading: string;
  subheading: string;
}

const Heading: FC<HeadingProps> = ({ heading, subheading }) => {
  return (
    <div className="flex flex-col flex-start mt-12">
      <h1 className="my-8 text-white font-sans text-6xl display-linebreak">{heading}</h1>
      <h3 className="text-light-grey font-normal leading-10 text-3xl display-linebreak">{subheading}</h3>
    </div>
  );
};

export default Heading;
